  input: TEXT,F3XA,,"In response to a question raised by the Reports Analysis Division
    in the letter dated May 14, 2003.   We have reviewed our records with respect
    to a payment reported on Schedule B, page 228/245 disclosing a $5,000 contribution
    to 'Kelly for Congress Campaign' for the retirement of debts by the 2002 primary
    election campaign.  This payment was returned by the Kelly for Congress Campaign
    and voided on 2/28/03.  The voided check was disclosed on Schedule B, page 12/15
    of the March Report (02/01/03-02/28/03).                                                                                                   We
    apologize for inadvertently omitting from our amended report electronically filed
    May 28, 2003; the second question raised in your letter dated May 14, 2003.              We
    have reviewed our records with respect to a payment reported on Schedule B, page
    221/245 disclosing a $10,000 disbursement to FPS & Associates.  We have amended
    this portion of the report referenced to include Schedule E, page 246/247 transferring
    from line 23 to line 24 the $10,000 payment to FPS & Associates."
